import { IonButtons, IonContent, IonFab, IonFabButton, IonHeader, IonIcon, IonMenuButton, IonPage, IonTitle, IonToolbar } from '@ionic/react';
import { add, card } from 'ionicons/icons';
import { useParams } from 'react-router';
import Card from '../../components/Card/Card';
import './Page.css';

const Management: React.FC = () => {

  const { name, title} = useParams<{ name: string, title: "agent" | "complex" | "package" | "promotion"}>();

  const addUrl = "/add/"

  interface Result {
    id: string;
    title: string;
    subtitle: string;
  }

  interface Agent {
    agentId: string;
    complexName: string;
    contractId: string;
    name: string;
    surname: string;
    id: string;
    cellNum: string;
    street1: string;
    street2: string;
    city: string;
    province: string;
    postalCode: string;
    password: string;
  }

  interface Complex {
    complexId: string;
    name: string;
    street1: string;
    street2: string;
    city: string;
    province: string;
    postalCode: string;
    telephoneNum: string;
    startTime: string;
    endTime: string;
    cellNum: string;
    units: [];
    agents: [];
  }

  interface Package {
    packageId: string;
    promotionId: string;
    packageName: string;
    minutes: number;
    standardPrice: string;
    suvPrice: string;
    description: string;
    onPromotion: boolean;
  }

  interface Promotion {
    promotionId: string;
    promotionName: string;
    packageName: string;
    standardPrice: string;
    suvPrice: string;
    isEnabled: boolean;
  }

  const result: Result =(
    {
      id:"",
      title:"",
      subtitle:"",
    }
  );

  if (title === "agent") {
    const agent: Agent = {
      agentId: "",
      complexName: "",
      contractId: "",
      name: "",
      surname: "",
      id: "",
      cellNum: "",
      street1: "",
      street2: "",
      city: "",
      province: "",
      postalCode: "",
      password: "",
    };

    result.id = agent.agentId;
    result.title = agent.name.concat(" ",agent.surname);
    result.subtitle = agent.complexName;

  } else if (title === "complex") {
    const complex: Complex = {
      complexId: "",
      name: "",
      street1: "",
      street2: "",
      city: "",
      province: "",
      postalCode: "",
      telephoneNum: "",
      startTime: "",
      endTime: "",
      cellNum: "",
      units: [],
      agents: [],
    };

    result.id = complex.complexId;
    result.title = complex.name;
    result.subtitle = complex.street2;
  } else if (title === "package") {
    const pack: Package = {
      packageId: "",
      promotionId: "",
      packageName: "",
      minutes: 0,
      standardPrice: "",
      suvPrice: "",
      description: "",
      onPromotion: false,
    };

    result.id = pack.packageId;
    result.title = pack.packageName;
    result.subtitle = pack.standardPrice;
  } else {
    const promotion: Promotion = {
      promotionId: "",
      promotionName: "",
      packageName: "",
      standardPrice: "",
      suvPrice: "",
      isEnabled: false,
    };

    result.id = promotion.promotionId;
    result.title = promotion.promotionName;
    result.subtitle = promotion.standardPrice;
  }
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonButtons slot="start">
            <IonMenuButton />
          </IonButtons>
          <IonTitle>{name.concat(" Management")}</IonTitle>
        </IonToolbar>
      </IonHeader>

      <IonContent fullscreen>
        <Card type={title} result={result} reference={name} />
        <IonFab vertical="bottom" horizontal="end" slot="fixed">
          <IonFabButton href={addUrl.concat(name,"/",title)}>
            <IonIcon icon={add} />
          </IonFabButton>
        </IonFab>
      </IonContent>
    </IonPage>
  );
};

export default Management;
